c_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=gr9P4PRLZJ4Ab5Dbblc&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAezxlf1-kytCYq_mfCjUJAB9XJ7RG15SpFilHHnxtXrA&oe=66182E67&_nc_sid=2999b8", "width": 1080, "height": 1920, "resolution": "1080x1920"}], "description": "Musabaha\n\nThe cousin of hummus üôÉüôÉüôÉ\nCheck out my live cooking classes. Click the link in my bio for more info\n\nIngredients:\n\n2 cups of hummus\n1 cup of boiled chickpeas\n3 cloves of garlic\n3 chilies\nBunch of parsley\n1 lemon\nOlive oil\n2 tbsps tahini\n2 tbsps yoghurt\nSalt & pepper\n\nStart by mashing the garlic and chili into a paste. Chop some parsley and add it to the dagga. Drizzle some olive oil on it till you get a sauce\n\nAdd most of the dagga to the hummus along with salt and pepper. Tahini. Lemon juice. And yoghurt. Mix and keep adding lemon till you thin it into a saucy consistency.\n\nAdd the mixture on top of the chickpeas and mix them.\n\nDrizzle with the remaining dagga and olive oil. Serve with some bread and enjoy‚ù§Ô∏è.\n\n#hummus #food #cooking #arabic #arabicfood #middleeast #middleeasternrecipe #palestine #gaza #spicy #vegetarian", "upload_date": "20240118", "uploader_id": "61374363757", "webpage_url": "https://www.instagram.com/reel/C2O4MuEMS7F/?igsh=MTBnZzk1M3c5cTRrOA==", "aspect_ratio": 0.56, "http_headers": {"Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8", "Referer": "https://www.instagram.com/", "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.19 Safari/537.36", "Sec-Fetch-Mode": "navigate", "Accept-Language": "en-us,en;q=0.5"}, "comment_count": 1779, "dynamic_range": "SDR", "extractor_key": "Instagram", "duration_string": "42", "webpage_url_domain": "instagram.com", "webpage_url_basename": "C2O4MuEMS7F"}', '2024-04-08 17:34:00.537390', '2024-04-08 17:34:00.537390', null);
