12665713}, {"id": "18090749137421818", "text": "Looks delicious! üëèüëè", "author": "naturalskincarespecialist", "author_id": "65143129093", "timestamp": 1712664218}, {"id": "18027451960999415", "text": "Meat eaters call vegans snowflakes. But tell them about cauliflower steak and watch them shit nails.", "author": "dr_en.vy", "author_id": "6984777563", "timestamp": 1712660358}, {"id": "17860295463114893", "text": "Looks amazing ü§§", "author": "frencheese.ro", "author_id": "64561971651", "timestamp": 1712652373}, {"id": "18026895757850993", "text": "@paulowhit üôå", "author": "jojowhitts", "author_id": "5961012194", "timestamp": 1712652346}, {"id": "18004628636402414", "text": "@mollysalisbury", "author": "anitasalisbury", "author_id": "2007278845", "timestamp": 1712649606}, {"id": "17902881653959765", "text": "@lsymng_  make this for meee", "author": "thedoublelifeofmarie", "author_id": "61406169443", "timestamp": 1712642608}, {"id": "18031701475761808", "text": "Love it! I‚Äôll try itüòã", "author": "camialvarezospina", "author_id": "663454831", "timestamp": 1712635149}, {"id": "18065530606510916", "text": "I do a similar one but take excess cauliflower, onion, Granny Smith apples and steam them till soft w garlic, etc and then make a pur√©e add vadovan curry then season n grill cauliflower that has already been steamed.  Sear both sides and add to sauce then top w pistachios, grapes, spinach n more", "author": "jacknvegas2", "author_id": "217273272", "timestamp": 1712631972}], "duration": 36.763, "protocol": "https", "uploader": "ALFIE STEINER", "audio_ext": "none", "extractor": "Instagram", "format_id": "0", "fulltitle": "Video by alfiecooks_", "thumbnail": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/430272549_354833960349293_6560159389185897935_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4yMTE0eDM3NTIuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=3lx9C8qk5GgAb6C5Soj&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAM8l6IdnVitfxavxl0tZ9OuGfwGdEtnUi3IvxNZa7Gdw&oe=661B26E9&_nc_sid=2999b8", "timestamp": 1709227880, "video_ext": "mp4", "display_id": "C38JjduK6vf", "like_count": 1007948, "resolution": "1080x1916", "thumbnails": [{"id": "0", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/430272549_354833960349293_6560159389185897935_n.jpg?stp=dst-jpg_e35_p640x640_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4yMTE0eDM3NTIuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=3lx9C8qk5GgAb6C5Soj&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfBxHJJ6UQxXEt0a2iL9ET_CKEe61fYpfILAr0cjFdFvDA&oe=661B26E9&_nc_sid=2999b8", "width": 640, "height": 1135, "resolution": "640x1135"}, {"id": "1", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/430272549_354833960349293_6560159389185897935_n.jpg?stp=dst-jpg_e35_p750x750_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4yMTE0eDM3NTIuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=3lx9C8qk5GgAb6C5Soj&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfB9rEG9hybUicOE9rZ3TvTprfiUOsAYNlhhnLr_t-03XA&oe=661B26E9&_nc_sid=2999b8", "width": 750, "height": 1331, "resolution": "750x1331"}, {"id": "2", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/430272549_354833960349293_6560159389185897935_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4yMTE0eDM3NTIuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=3lx9C8qk5GgAb6C5Soj&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAM8l6IdnVitfxavxl0tZ9OuGfwGdEtnUi3IvxNZa7Gdw&oe=661B26E9&_nc_sid=2999b8", "width": 1080, "height": 1916, "resolution": "1080x1916"}], "description": "CAULIFLOWER STEAK + CHIMICHURRI üî•\n\nof my favourite ways to cook cauliflower is to cut it into steaks, then serve with chimichurri + a creamy butter bean pur√©e.\n\nit sounds fancy, but it‚Äôs actually super easy to make, comes together in no time at all & uses only simple, plant-based ingredients üå±\n\nI‚Äôve written the full recipe out for you below so enjoy & let me know if you give it a go üëá\n\nINGREDIENTS (serves 2)\n\nCAULI\n\n2 cauliflower steaks (from 1 large cauli)\n1 tbsp smoked paprika \n3 garlic cloves\n2 tbsp butter \nSalt\nPepper\nOlive oil\n\nCHIMICHURRI\n\nLarge bunch of parsley \n1 garlic clove \n1 red chilli\n2 tbsp red wine vinegar\n100ml extra virgin olive oil\nSalt\nPepper\n\nBUTTER BEAN PUR√âE\n\n700g jarred butter beans\n1 lemon\n1 garlic clove \n2 tbsp nutritional yeast\nSalt\nPepper\n\nMETHOD\n\n1. First, make the chimichurri. Finely chop the fresh herbs, then add to a mixing bowl. Finely dice the chilli, mince the garlic + add to the herbs with the vinegar. Season to taste, then stream in the olive oil whilst mixing until throughly combined. Set aside.\n2. For the butter beans, simply pour  into a blender with the juice of a lemon, salt, pepper, 1 garlic clove + nutritional yeast. \n3. For the cauliflower, chop into steaks- you should be able to get two from the middle of a large one. Save the extra florets for another recipe, or roast with salt, pepper, paprika + olive oil to serve alongside the steaks.\n4. Chop up the leaves + stems & set aside for a zero-waste garnish. \n5. Season the steaks with salt, pepper + paprika on both sides, then drizzle with oil + massage well.\n6. Heat a frying pan to medium high. Add 2 tbsp olive oil. Once hot, add the steak - press down to sear. After several minutes, flip + fry other side until golden brown. \n7. Bash the garlic cloves, add with the butter + baste continuously. Once the steaks are cooked, remove from the pan + add the chopped leaves/stems with a splash more oil & cook until golden + crisp.\n8. To serve, pour the bean pur√©e into the middle of a plate. Place the steak on top, drizzle with chimichurri & scatter over the cauli leaves.\n\n#cauliflower #steak #steakdinner #healthyrecipes #easyrecipes", "upload_date": "20240229", "uploader_id": "11621708566", "webpage_url": "https://www.instagram.com/reel/C38JjduK6vf/?igsh=bzZ