 "ceyorganics", "author_id": "56754092192", "timestamp": 1712275147}, {"id": "18120293845354736", "text": "What kind of potatoes did you use?", "author": "whalesandwonder", "author_id": "44467480150", "timestamp": 1712251390}, {"id": "17883204897030189", "text": "@i_am_bravecreewoman", "author": "tig_rig_gypsy", "author_id": "1828465693", "timestamp": 1712202867}, {"id": "18018074495481282", "text": "thats not a soup though warm smoothie i call it", "author": "muhammetalibac", "author_id": "47086720288", "timestamp": 1711823053}, {"id": "18001235270292089", "text": "I think this should be titled white girl food", "author": "mikestillp", "author_id": "34495475501", "timestamp": 1711626011}, {"id": "18024126059059953", "text": "üòî I made it but not enough broccoli", "author": "im_victoria_repka", "author_id": "62193399580", "timestamp": 1711590865}, {"id": "18121724356346788", "text": "Do you have to boil the potatoes first?", "author": "aliza0__0", "author_id": "44275924468", "timestamp": 1711524987}, {"id": "18066157564460755", "text": "FREE PALESTINE üíñ food looks good", "author": "emptyheadpleasefill", "author_id": "3507177512", "timestamp": 1711461685}], "duration": 26.934, "protocol": "https", "uploader": "Yumna | Feel Good Foodie", "audio_ext": "none", "extractor": "Instagram", "format_id": "0", "fulltitle": "Video by feelgoodfoodie", "thumbnail": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/428425318_3214634635348298_2009722141426759346_n.jpg?stp=dst-jpg_e15&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43MjB4MTI4MC5zZHIifQ&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=fZKck-nw4bMAb7odiLo&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAHoEqHgbtwm7I6diP-fIwldkHwW9nmW6S6F8sa5aeLeQ&oe=661B438A&_nc_sid=2999b8", "timestamp": 1708311749, "video_ext": "mp4", "display_id": "C3g2Mk_ubVd", "like_count": 176161, "resolution": "750x1333", "thumbnails": [{"id": "0", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/428425318_3214634635348298_2009722141426759346_n.jpg?stp=dst-jpg_e15_p640x640&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43MjB4MTI4MC5zZHIifQ&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=fZKck-nw4bMAb7odiLo&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfBHm9QiJQIMCFHOH2KPmE0DW2S01Ka3n9FKkni89dK1ZA&oe=661B438A&_nc_sid=2999b8", "width": 640, "height": 1137, "resolution": "640x1137"}, {"id": "1", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/428425318_3214634635348298_2009722141426759346_n.jpg?stp=dst-jpg_e15&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43MjB4MTI4MC5zZHIifQ&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=fZKck-nw4bMAb7odiLo&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAHoEqHgbtwm7I6diP-fIwldkHwW9nmW6S6F8sa5aeLeQ&oe=661B438A&_nc_sid=2999b8", "width": 750, "height": 1333, "resolution": "750x1333"}, {"id": "2", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/428425318_3214634635348298_2009722141426759346_n.jpg?stp=dst-jpg_e15&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43MjB4MTI4MC5zZHIifQ&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=fZKck-nw4bMAb7odiLo&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfAHoEqHgbtwm7I6diP-fIwldkHwW9nmW6S6F8sa5aeLeQ&oe=661B438A&_nc_sid=2999b8", "width": 1080, "height": 1920, "resolution": "1080x1920"}], "description": "If you liked the roasted feta tomato soup, try this broccoli and cheese version - it‚Äôs so creamy so so good!! ü•¶ü•£\n\nINGREDIENTS\n1 (8-ounce) feta chunk\n4 cups broccoli florets\n1 pound potatoes, peeled & chopped\n1 onion, chopped\n4-5 sprigs thyme\n1 bulb garlic, sliced at the top \n¬Ω teaspoon salt \n1 teaspoon black pepper\n¬º cup olive oil \n4 cups vegetable broth \nINSTRUCTIONS\nPreheat the oven to 400¬∞F. Line a large baking sheet with parchment paper.\nPlace the feta, broccoli, potatoes, onion, thyme and garlic in on the prepared sheet pan. Season everything with black pepper and drizzle with olive oil.\nBake in the preheated oven for 30 minutes, or until the vegetables are tender and the feta is melty. \nRemove the roasted garlic bulb and set aside until cool enough to handle.\nTransfer the roasted vegetables and feta into a blender. Carefully squeeze the roasted garlic into the blender and add the vegetable broth. Blend for 2 minutes, or until smooth and creamy.", "upload_date": "20240219", "uploader_id": "470174409", "webpage_url": "https://www.instagram.com/reel/C3g2Mk_ubVd/?igsh=MTFxZ3BpbGpsNm94Mg==", "aspect_ratio": 0.56, "http_headers": {"Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8", "Referer": "https://www.instagram.com/", "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/95.0.4638.69 Safari/537.36", "Sec-Fetch-Mode": "navigate", "Accept-Language": "en-us,en;q=0.5"}, "comment_count": 616, "dynamic_range": "SDR", "extractor_key": "Instagram", "duration_string": "26", "webpage_url_domain": "instagram.com", "webpage_url_basename": "C3g2Mk_ubVd"}', '2024-04-09 15:07:58.379540', '2024-04-09 15:08:01.956918', 3);
