or sharing!", "author": "carbonfarmers", "author_id": "41144531153", "timestamp": 1712645512}, {"id": "18019558409487489", "text": "Nice üëè", "author": "styledbylida", "author_id": "55086156384", "timestamp": 1712635205}, {"id": "17963366441725759", "text": "@simuli79", "author": "pirref", "author_id": "390586721", "timestamp": 1712606388}, {"id": "17991587510459181", "text": "üëèüëèüëèüëèüëèüëè", "author": "seumocodacostela", "author_id": "24783538321", "timestamp": 1712596861}, {"id": "17882036913041957", "text": "@antonytcphillips", "author": "kstoc", "author_id": "2019649975", "timestamp": 1712552864}, {"id": "17860038168113503", "text": "üëè", "author": "xioma.147", "author_id": "52062022707", "timestamp": 1712526906}, {"id": "17930116802837055", "text": "üôåüî•üôåüçÄüåπüçÄ", "author": "rosaschweighardt", "author_id": "14690045210", "timestamp": 1712503307}, {"id": "17857228473141034", "text": "@___trigger @duhoneddie @tnmoore27 @krachelle99 @kaila_21", "author": "duhonmaggie", "author_id": "1981445332", "timestamp": 1712499151}], "duration": 28.304, "protocol": "https", "uploader": "Chris Collins", "audio_ext": "none", "extractor": "Instagram", "format_id": "0", "fulltitle": "Video by dontgobaconmyheart_", "thumbnail": "https://scontent-lhr6-1.cdninstagram.com/v/t51.29350-15/424995859_401939268860050_1335662403712849726_n.jpg?stp=dst-jpg_e15&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43NzJ4MTM3MC5zZHIifQ&_nc_ht=scontent-lhr6-1.cdninstagram.com&_nc_cat=110&_nc_ohc=C767Rgz-BKgAb6B1Ym_&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfB8eG_ia4S24VrfpiJkOFlTqcOcHAIZC84ARZNM-AWhYQ&oe=661B26FA&_nc_sid=2999b8", "timestamp": 1707165814, "video_ext": "mp4", "display_id": "C2-sFGIIumo", "like_count": 121855, "resolution": "1080x1916", "thumbnails": [{"id": "0", "url": "https://scontent-lhr6-1.cdninstagram.com/v/t51.29350-15/424995859_401939268860050_1335662403712849726_n.jpg?stp=dst-jpg_e15_p640x640&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43NzJ4MTM3MC5zZHIifQ&_nc_ht=scontent-lhr6-1.cdninstagram.com&_nc_cat=110&_nc_ohc=C767Rgz-BKgAb6B1Ym_&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfDgSfJXF_A0DVns8i6AK53D_ZXRkHiw_eYeTOWaj-mRhA&oe=661B26FA&_nc_sid=2999b8", "width": 640, "height": 1135, "resolution": "640x1135"}, {"id": "1", "url": "https://scontent-lhr6-1.cdninstagram.com/v/t51.29350-15/424995859_401939268860050_1335662403712849726_n.jpg?stp=dst-jpg_e15_p750x750&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43NzJ4MTM3MC5zZHIifQ&_nc_ht=scontent-lhr6-1.cdninstagram.com&_nc_cat=110&_nc_ohc=C767Rgz-BKgAb6B1Ym_&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfCTf9lrLXxGSbFoVfKp3zoY5aYjPHNVCthCTu2EJcdGfg&oe=661B26FA&_nc_sid=2999b8", "width": 750, "height": 1330, "resolution": "750x1330"}, {"id": "2", "url": "https://scontent-lhr6-1.cdninstagram.com/v/t51.29350-15/424995859_401939268860050_1335662403712849726_n.jpg?stp=dst-jpg_e15&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi43NzJ4MTM3MC5zZHIifQ&_nc_ht=scontent-lhr6-1.cdninstagram.com&_nc_cat=110&_nc_ohc=C767Rgz-BKgAb6B1Ym_&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfB8eG_ia4S24VrfpiJkOFlTqcOcHAIZC84ARZNM-AWhYQ&oe=661B26FA&_nc_sid=2999b8", "width": 1080, "height": 1916, "resolution": "1080x1916"}], "description": "There‚Äôs no better way to say ‚ÄòI love you‚Äô than with edible roses ü•îüåπ‚ù§Ô∏è Enjoy!! Chris x\n\nPOTATO ROSES | Makes 6\n\nINGREDIENTS\n\n600g / 1.3lb¬†Baking Potatoes\n1.5¬†tbsp¬†Olive Oil\n1¬†tsp very finely diced¬†Fresh Rosemary\n2¬†cloves of¬†Garlic,¬†finely grated\n1/2¬†tsp¬†Salt\n1/4¬†tsp¬†Black Pepper\n60g / 2oz¬†Parmesan\n6¬†slices of¬†Streaky Bacon*\n\nMETHOD\n\n1Ô∏è‚É£Preheat oven to 190C/375F. Generously grease 6 holes of a muffin tray.\n2Ô∏è‚É£Use a mandoline to thinly cut them into 2mm slices (discard the very ends of the potatoes). I recommend using a finger guard, at least when you get closer to the blade. Use kitchen roll to dry the slices as best you can.\n3Ô∏è‚É£Toss the slices in a large bowl with olive oil, rosemary, garlic, salt and pepper until everything is well-distributed. Place 1/6th of the slices in a row, overlapping by around 2/3-3/4 of the previous slice (usually around 15 slices). Sprinkle 1/6th of the parmesan over the slices (around 1 tbsp) then place a slice of bacon next to them.\n4Ô∏è‚É£Roll up the potato slices then wrap them in the bacon. Place in the muffin tray & gently fan out the petals so it looks like a rose. Repeat to create 6 roses. Try & work quickly to prevent potatoes getting watery (not a huge issue as the moisture will evaporate in the oven, just more difficult to work with).\n5Ô∏è‚É£Bake roses uncovered for 20mins. Tightly cover the roses with foil, then place back in the oven for 35-45mins, or until the potatoes are crisp & tender right the way through. Use a spoon to carefully remove the roses from & enjoy!\n\n*This is mainly used to keep the roses intact. I initially tried rolling it up with the slices (i.e the slices on top of the bacon) but found the bacon in the centre of the roses was chewy and essentially poached in the moisture from the potatoes. I find the bacon more useful as a ‚Äòstring‚Äô around the outside.\n\n**Timings will differ based on how your oven runs and how thick the roses end up. Don‚Äôt be scared to continue baking for longer if they‚Äôre still not cooked (consider dropping heat if they‚Äôre browning too much). Or if they‚Äôre struggling to brown at all you can remove the foil at the end.", "upload_date": "20240205", "uploader_id": "2019660649", "webpage_url": "https://www.instagram.com/reel/C2-sFGIIumo/?igsh=MXA3cDZtNmgxdXJ4dg==", "aspect_ratio": 0.56, "http_headers": {"Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8", "Referer": "https://www.instagram.com/", "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/92.0.4515.107 Safari/537.36", "Sec-Fetch-Mode": "navigate", "Accept-Language": "en-us,en;q=0.5"}, "comment_count": 608, "dynamic_range": "SDR", "extractor_key": "Instagram", "duration_string": "28", "webpage_url_domain"