_nc_ohc=YcolQ8QingEAb5KcXpz&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfCe56BAgUC8FzY54kcqzIBSU8Ge7btpt1CAEapUWDhHhA&oe=66178B45&_nc_sid=2999b8", "timestamp": 1710191400, "video_ext": "mp4", "display_id": "C4Y3U7-vKxF", "like_count": 53073, "resolution": "1080x1920", "thumbnails": [{"id": "0", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/432568903_725877849659117_424206666109668108_n.jpg?stp=dst-jpg_e35_p640x640_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4xMDgweDE5MjAuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=YcolQ8QingEAb5KcXpz&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfDt1KHLj6JeVO4HabpfBVRVKjcYdRGEqzpuEbmuILeItQ&oe=66178B45&_nc_sid=2999b8", "width": 640, "height": 1137, "resolution": "640x1137"}, {"id": "1", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/432568903_725877849659117_424206666109668108_n.jpg?stp=dst-jpg_e35_p750x750_sh0.08&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4xMDgweDE5MjAuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=YcolQ8QingEAb5KcXpz&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfDYnXRDODRZoeB8ly-NUOQF4sDXumnLi8PlSNuWG64gCA&oe=66178B45&_nc_sid=2999b8", "width": 750, "height": 1333, "resolution": "750x1333"}, {"id": "2", "url": "https://scontent-lhr6-2.cdninstagram.com/v/t51.29350-15/432568903_725877849659117_424206666109668108_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&efg=eyJ2ZW5jb2RlX3RhZyI6ImltYWdlX3VybGdlbi4xMDgweDE5MjAuc2RyIn0&_nc_ht=scontent-lhr6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=YcolQ8QingEAb5KcXpz&edm=AP_V10EBAAAA&ccb=7-5&oh=00_AfCe56BAgUC8FzY54kcqzIBSU8Ge7btpt1CAEapUWDhHhA&oe=66178B45&_nc_sid=2999b8", "width": 1080, "height": 1920, "resolution": "1080x1920"}], "description": "Have you tried Yaki Onigiri? ü§§\n\nI love a classic Japanese onigiri, but the extra crunch in this Yaki Onigiri is next level! These are super EASY to make and customize. I made a classic yaki onigiri without any filling, but these are great with spicy tuna, salmon, and other fillings too üòã\n\nüìù Ingredients ‚Äî makes 6 Yaki Onigiri\n\nSushi Rice\n‚ñ¢ 1 ¬Ω¬†cup¬†uncooked sushi rice\n‚ñ¢ 2¬†cups¬†water\n‚ñ¢ 2¬†teaspoon¬†toasted black sesame seeds\n‚ñ¢ 2¬†teaspoon¬†sesame oil\n\nSoy Glaze\n‚ñ¢ ¬º¬†cup¬†soy sauce\n‚ñ¢ 2¬†tablespoon¬†mirin\n‚ñ¢ 1¬†teaspoon¬†sugar\n\nüë©üèª‚Äçüç≥ Instructions\n\n1. Cook the sushi rice in a rice cooker. Then while warm, season with seasoning ingredients above.\n\n2. Make the onigiri triangle shapes with a mold. \n\n2.5 (Optional) Add your favorite filling into the center at this step.***\n\n3. Mix together the soy sauce, sugar, and mirin for the soy glaze mixture.\n\n4. Lightly oil a medium skillet and heat it over medium heat. Sear each side of every onigiri until golden brown.\n\n5. Working QUICKLY, brush each onigiri with the soy glaze and flip to caramelize the onigiri for 10 seconds on each side.\n\n6. Enjoy!\n.\n.\n.\n#onigiri¬†#japaneserecipe¬†#japanesericeball¬†#japanesericeballs¬†#yakionigiri¬†#easyrecipe¬†#asiancooking¬†#asianrecipes #easysnacks¬†#üçô¬†#riceball¬†#riceballs", "upload_date": "20240311", "uploader_id": "41378426399", "webpage_url": "https://www.instagram.com/reel/C4Y3U7-vKxF/?igsh=MTk4ZnRpdDlxa21qag==", "aspect_ratio": 0.56, "http_headers": {"Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8", "Referer": "https://www.instagram.com/", "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/97.0.4692.20 Safari/537.36", "Sec-Fetch-Mode": "navigate", "Accept-Language": "en-us,en;q=0.5"}, "comment_count": 197, "dynamic_range": "SDR", "extractor_key": "Instagram", "duration_string": "35", "webpage_url_domain": "instagram.com", "webpage_url_basename": "C4Y3U7-vKxF"}', '2024-04-08 17:34:00.537390', '2024-04-09 18:16:27.094917', 8);
